import React, { useEffect, useState } from "react";
import { db } from "./utils/config";
import { collection, getDoc, addDoc, updateDoc, doc } from "firebase/firestore";

import "./style/app.css";
import Navbar from "./components/navbarcomp/Navbar";
import Register from "./components/registercomp/Register";
import Login from "./components/logincomp/Login";

function App() {
  const [users, setUsers] = useState(null);
  const usersCollection = doc(db, "users", "7gVzACeuCqtE0Kqi9Ecx");
  useEffect(() => {
    const getUsers = async () => {
      const dataSnap = await getDoc(usersCollection);
      setUsers(dataSnap);
    };
    getUsers();
    console.log(users);
  }, []);

  return (
    <div>
      <Register />
      <Login />
      <Navbar />

      <div style={{ color: "aliceblue" }}>
        {/* <h1>Name : {users?.data?.strategytags[0]}</h1> */}
        {/* <h1>Age : {users.trades[1].straddle}</h1>
        {/* <h1>Age : {users.strategytags[0]}</h1>
        <h1>Age : {users.trades[0].straddle}</h1>
        <h1>Age : {users.trades[1].straddle}</h1> */}
      </div>
    </div>
  );
}

export default App;
